class Solution867{
	public int[][] transpose(int[][] matrix) {
		int[][] tMat = new int[matrix[0].length][matrix.length];
		for (int i=0; i<matrix.length; i++) {
			for (int j=0; j<matrix[0].length; j++) {
				tMat[j][i] = matrix[i][j];
			}//rof
		}//rof
        return tMat;
	}//end method
}// end class
